import "./styles.css";
import React from "react";
import { BrowserRouter, Routes, Route , Link} from "react-router-dom";
import BookDetails from "./components/BookDetails";
import Search from "./components/Search";
import BookInterface from "./components/BookInterface";
import {Genre} from "./components/Genre";
import AddBook from "./components/AddBook";
import Menu from "./components/Menu";
import AboutUs from "./components/AboutUs";

export default function App() {
	
	const demoBook={
		title: "Midnight",
		author: "Tony Heart",
		genre: Genre.Action,
		pages: 99, 
		ISBN:"foew", 
		image:"data:image/png;base64,"
	}
	const demoBook2={
		title: "Summer",
		author: "Tony Heart",
		genre: Genre.Romance,
		pages: 60, 
		ISBN:"a39eir", 
		image:"data:image/png;base64,"
	}
	const demoBook3={
		title: "Finance",
		author: "Tony Heart",
		genre: Genre.Romance,
		pages: 60, 
		ISBN:"efes", 
		image:"data:image/png;base64,"
	}
	
  const [books, setBooks] = React.useState<BookInterface[]>([demoBook,demoBook2,demoBook3]);

  const handleSaveDetails = (newBooks: BookInterface[]) => {
    setBooks(newBooks);
  }
  
  const handleAddBook = (book: BookInterface) => {
	let newBooks = Array.from(books);
	newBooks.push(book);
	setBooks(newBooks);
	console.log(newBooks);
  }
  
  const handleRemoveBook = (isbn: string) => {
	let newBooks = Array.from(books);
	console.log(newBooks);
	for( var i = 0; i < newBooks.length; i++){ 
        if ( newBooks[i].ISBN === isbn) { 
            newBooks.splice(i, 1);
			console.log(newBooks);
			setBooks(newBooks);
			return;
        }
    }
  }

  return (
    <BrowserRouter>
      <div className="App">
		<Menu/>
		<hr id="menuLine"/>
		<Routes>
			<Route path="*" element={<Search books={books} />}/>
			<Route path="/details/:id" element={<BookDetails saveDetails={handleSaveDetails} removeBook={handleRemoveBook} books={books}/>}/>
			<Route path="/addBook" element={<AddBook addBook={handleAddBook}/> }/>
			<Route path="/aboutUs" element={<AboutUs/> }/>
		</Routes>
      </div>
    </BrowserRouter>
  );
}
